import React from "react";
import Bookshelf from "./Components/Bookshelf";
import Bookcard from "./Components/Bookcard";
import Jumbotron from "./Components/Jumbotron";


function App() {
  return (
      <div>
        <Jumbotron/>
          <Bookshelf>
          <Bookcard/>
        </Bookshelf>
      </div>
  );
}

export default App;
